    public void OnSupplierChange(Syncfusion.Blazor.DropDowns.ChangeEventArgs<int?, AproductSupplier> args)
    {
        try
        {
            int val = Convert.ToInt32(args.Value);
            Product = _context.ViewProducts.Where(o => o.SupplierId == val).ToList();

            using (var dbContext = new SPToCoreContext())
            {
                var exists = dbContext.SupplierOrderHeaders.FirstOrDefault(o => o.OrderNumber == ArtOrders.OrderNumber);
                if (exists != null)
                {
                    exists.OrderDate = ArtOrders.OrderDate;
                    //exists.OrderSubmitted = ArtOrders.OrderSubmitted;
                    //exists.OrderConfirmed = ArtOrders.OrderConfirmed;
                    exists.OrderStatus = 1;
                    exists.SupplierId = val;
                    dbContext.Entry(exists).State = EntityState.Modified;
                }
                else
                {
                    SupplierOrderHeader order = new SupplierOrderHeader();
                    order.OrderNumber = ArtOrders.OrderNumber;
                    order.OrderDate = ArtOrders.OrderDate;
                    //order.OrderSubmitted = ArtOrders.OrderSubmitted;
                    //order.OrderConfirmed = ArtOrders.OrderConfirmed;
                    order.OrderStatus = 1;
                    order.SupplierId = val;
                    dbContext.SupplierOrderHeaders.Add(order);
                }
                dbContext.SaveChanges();

                ChildQuery = new Query().AddParams("OrderNumber", ArtOrders.OrderNumber).AddParams("SupplierId", ArtOrders.SupplierId);
            }

        }
        catch (Exception ex)
        {
